- input: "TEXT\x1CC00553685\x1C.TEXT\x1C\x1CF3A\x1CThe campaign tried to file the
    End of Year report online, but were unable to do so due to a software glitch.
    A required document submitted on January 23, 2014 did not yet show in the system
    so the campaign did not timely receive the filing password. A paper/hard copy
    of this report was overnighted to the FEC along with a screen shot showing the
    error code. The FEC technical team was instrumental in resolving the issue and
    verified the required document had in fact been in the system since January 23,
    2014.\n"
